import './App.css';

function App() {
  return (
    <div className='flex-1 flex-col items-start justify-center text-center'>
      <p className='font-inter font-bold text-3xl mt-[43px]'>Welcome to Discal!</p>
      <p className='font-inter font-bold'>Total discounted price</p>
    </div>
  );
}

export default App;
